   # This function finds, extracts, decodes and displays files and directories
   # from the standard HTK payload, for the user, to allow them to explore what
   # is included therein.  The single optional argument allows the user to
   # search for a pattern to extract from the payload.
   local MYTMP=$(mktemp -d /tmp/htk.XXX)
   #
   #
   ########################## old code #########################################
   #############################################################################
   #yolk_2_stdout $MPLD $0 |tar -zxf - -C $MYTMP --wildcards \*$1\* 2>$DN
   #############################################################################
   ########################## old code #########################################
   #
